import { useSelector } from "react-redux";
import { Col, Row } from "react-bootstrap";
const FavouriteJobs = () => {
  const myFavList = useSelector((state) => state.favJobs.content);

  return (
    <Row>
      <Col sm={12}>
        <ul>
          {myFavList.map((data, i) => (
            <li key={i} className="my-4"></li>
          ))}
        </ul>
      </Col>
    </Row>
  );
};

export default FavouriteJobs;
